import React, { useState } from 'react';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import DoubleArrowIcon from '@material-ui/icons/DoubleArrow';
import Collapse from '@material-ui/core/Collapse';
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';
import StarBorder from '@material-ui/icons/StarBorder';
import styles from './MusicCollection.module.css'; 

class MusicCollection extends React.Component {
  constructor(props){
    super(props);
  }
   render(){ 
    const playLists = this.props.collection;
     return (
     <MusicPlayerView playLists = {playLists}>
     </MusicPlayerView>
     )
   }
}


class MusicPlayerView extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      items: Array(this.props.playLists.length).fill(false),
    };
  }

  addItem(index){
    let tmpItems = this.state.items.slice();
    tmpItems[index] = !tmpItems[index];
    this.setState({items: tmpItems});
  }
  render(){

  const playLists2 = this.props.playLists.map((playlist, index) => {
    return(<Collapse in={this.state.items[index]} timeout="auto" unmountOnExit>
    <List component="div" disablePadding>
      <ListItem button onClick={() => {
        console.log('button pressed');
      }}>
        <ListItemIcon>
          <StarBorder />
        </ListItemIcon>
        <ListItemText primary= {playlist.songs[0]} />
      </ListItem>
    </List>
  </Collapse>);
  });

  const playLists = this.props.playLists.map((playlist, index) => {
    const myArray = new Array();
    myArray.push('Bes Song ever');
    myArray.push('Just something');
    return (
      <List key = {index} className={styles.root}>
        <ListItem button onClick={() => this.addItem(index)}
          className={styles.nested}>
        <ListItemIcon>
          <DoubleArrowIcon />
        </ListItemIcon>
        <ListItemText primary= {playlist.name} />
        {this.state.items[index] ? <ExpandLess /> : <ExpandMore />}
      </ListItem>
      <this.playLists2></this.playLists2>
      <Collapse in={this.state.items[index]} timeout="auto" unmountOnExit>
        <List component="div" disablePadding>
          <ListItem button onClick={() => {
            console.log('button pressed');
          }}>
            <ListItemIcon>
              <StarBorder />
            </ListItemIcon>
            <ListItemText primary= {playlist.songs[0]} />
          </ListItem>
        </List>
      </Collapse>
      </List>
    )
  });
  console.log(playLists);
  return (
    <div>
    <ol>{playLists}</ol></div>

  )
  }
}

export default MusicCollection
